from dataclasses import dataclass

@dataclass
class Triple:
    subject: str
    predicate: str
    object: str

# EVOLVE-BLOCK-START

def predict(triples: list[Triple]) -> str:
    if not triples:
        return ""

    subject = triples[0].subject

    combined_sentence = f"{subject} "

    for triple in triples:
        predicate = triple.predicate
        obj = triple.object

        if predicate == "associatedBand/associatedMusicalArtist":
            combined_sentence += f"is associated with {obj}"
        elif predicate == "background":
            combined_sentence += f"has a background as a {obj}"
        elif predicate == "birthDate":
            combined_sentence += f"was born on {obj}"
        elif predicate == "genre":
            combined_sentence += f"performs {obj} music"
        else:
            combined_sentence += f"{predicate} is {obj}"

    return combined_sentence

